import React, { useState } from "react";

function Timp(props) {

  const sec = props.DigitFour.toString() + props.DigitThere.toString() + props.DigitTwo.toString() + props.DigitOne.toString();

  const nr = sec.split("");
  let n = "";
  for (let i = 0; i < nr.length; i++){
    if (nr[i] !== 0) {
      n += nr[i];
    }
  } 

  return (
    <>
      <h2>
        Timp trecut: {props.DigitFour % 10}
        {props.DigitThere % 10}
        {props.DigitTwo % 10}
        {props.DigitOne % 10}
      </h2>
    </>
  );
}

export default Timp;
